import Art from './components/Art.js';
import axios from "axios";
import React, { useEffect, useState } from "react";

function App() {
  const [apiData, setApiData] = useState();

  const getAnswer = async () => {
    const { data } = await axios("");
    setApiData(data.answer);
    console.log(data)
  };

  useEffect(() => {
    getAnswer();
  }, []);


  return (
    <Art/>
  );
}

export default App;
